const BASE_URL = 'http://localhost:3000'
const TODOS_URL = `${BASE_URL}/todos`

export const login_success = (formData) => {
    console.log(formData)
    reqObj = {
        method: 'POST',
        headers: {
            'content-type': 'application.json'
        },
        body: JSON.stringify()
    }
    fetch(TODOS_URL, reqObj)
    .then(res => res.json())
}
